import React from 'react';

const Home = () => {
  return (
    <section id="home" className="home">
      <h1>Anniston Fees</h1>
      <p>Full Stack Developer | Cloud Practitioner | Multilingual Professional</p>
      <button><a href="#projects">View My Work</a></button>
    </section>
  );
};

export default Home;
